	private static void GenerateOriginalDataFragments(int oriSize, List<BinaryModification> records, List<OriginalDataFragment> fragments)
	{
		fragments.Add(new OriginalDataFragment(0, oriSize, 0));
		int i = 0;
		for (int count = records.Count; i < count; i++)
		{
			BinaryModification binaryModification = records[i];
			switch (binaryModification.Type)
			{
			case 0:
				OriginalDataFragmentsHelper.ApplyInsertRecord(fragments, binaryModification.Offset, binaryModification.Size);
