					Buffer.MemoryCopy(rawData + originalDataFragment.OriOffset, ptr + originalDataFragment.CurrOffset, originalDataFragment.Size, originalDataFragment.Size);
				}
			}
		}
		block.SetRawData(array);
	}

	private unsafe static void RestructureFromSyncData(IBinary block, byte* pSyncData, int syncDataSize, List<(int offset, int size)> newDataInfos)
	{
